import React from "react";
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator';

const DoctorScheduleTable = (props) => {

    const columns = [
        {
        dataField: 'index',
        text: ' '
      }, 
      {
        dataField: 'speciality',
        text: 'Speciality'
      }, 
      {
        dataField: 'lastname',
        text: 'Lastname'
      }, 
      {
        dataField: 'shiftStart',
        text: 'Shift Start'
      }, 
      {
        dataField: 'shiftEnd',
        text: 'Shift End'
      }, 
      {
        dataField: '',
        text: 'Options',
        formatter: this.addOptions()
      }
    ];

      
  const { doctorSchedule  } = props
    addOptions = (rowContent, row) => {
            return (    
            <button type="button" class="btn btn-primary"> Add Appoinment</button>
            )
    }
    

  return (
    <div className="container mt-2">
      
    <BootstrapTable bootstrap4 
        keyField='index' 
        data={  doctorSchedule  } 
        columns={ columns } 
        pagination={ paginationFactory() } />
    </div>
  );
}

export default DoctorScheduleTable ;
